import React, { useState } from 'react'

export default function Pcard(props) {    
    const [loadInfo,setLoadinfo]=useState(false);
    const Load=()=>
    {
        setLoadinfo(!loadInfo);
    }
    return (

    <div onClick={Load} Style='width:150px;height:200px;background-color:red;margin:2px'>
      <div>{props.name}</div>
      <div>{props.des}</div>
      <div>{props.resouces}</div>
    </div>


  )
}
